import "./Registration.css";
import React from "react";

function template() {
  const {name}=this.state.data; 
  // const {class}=this.state.data;
  const {location}=this.state.data;
  return (

    <div className="registration">
      <h1>---------Registration---------</h1>
      <h2>Enter Name:<input value={name} id="name" onChange={this.fn.bind(this)}/></h2>
      <h2>Enter Class:<input id="class" onChange={this.fn.bind(this)}/></h2>
      <h2>Enter Location:<input value={location} id="location" onChange={this.fn.bind(this)}/></h2>
    </div>
  );
};

export default template;
